import {FilterScript2, hideShowTable} from '../js/uebersicht';

export default function Content({content}) {
    return(

        <div id = "outer_frame">
            <button class="hide_columns" onClick={()=>SpaltenScript()}>Spalte ></button>
            <div id="checkboxes" class = "sidenav">

                <ul>
                    <li><input type="checkbox" value="show" id="subject_col" onChange={()=>hideShowTable(this.id)} checked/><label>Fach</label></li>
                    <li><input type="checkbox" value="show" id="day_col" onChange={()=>hideShowTable(this.id)} checked/><label>Tag</label></li>
                    <li><input type="checkbox" value="show" id="time_col" onChange={()=>hideShowTable(this.id)} checked/><label>Uhrzeit</label></li>
                    <li><input type="checkbox" value="show" id="room_col"  onChange={()=>hideShowTable(this.id)} checked/><label>Raum</label></li>
                    <li><input type="checkbox" value="hide" id="prof_col"  onChange={()=>hideShowTable(this.id)} /><label>Dozent</label></li>
                    <li><input type="checkbox" value="hide" id="length_col"  onChange={()=>hideShowTable(this.id)} /><label>LÃ¤nge</label></li>
                    <li><input type="checkbox" value="hide" id="type_col"  onChange={()=>hideShowTable(this.id)} /><label>Form</label></li>
                    <li><input type="checkbox" value="hide" id="save_col"  onChange={()=>hideShowTable(this.id)} /><label>Speichern</label></li>
                </ul>
            </div>
            <div id = "inner_frame">
                {content}
            </div>
        </div>
    );
}

function SpaltenScript() {
    const columns_btn = document.querySelector('.hide_columns');
    const checkboxes = document.querySelector('#checkboxes');
    const inner_frame = document.querySelector('#inner_frame');

    columns_btn.classList.toggle('is-active');
    checkboxes.classList.toggle('is-active');
    inner_frame.classList.toggle('is-active');

    columns_btn.firstChild.data = columns_btn.firstChild.data == "<" ? "Spalten >" : "<";
}
